import React, { useRef, useState } from "react";

export default function Main() {
  const f = useRef();
  const [data, setData] = useState();

  const [item, setItem] = useState([]);

  
  function fun(a) {
    setData(a.target.value);
  }

  function fun2() {
    setItem((fun3) => [...fun3, data]);
    setData("");
    f.current.focus();
  } 
  return (
    <div>
      {/* <h1>hello</h1> */}
      <input type="text" onChange={fun} value={data} ref={f} />
      <button onClick={fun2}>+</button>
      {/* <h1>{data}</h1> */}

      {item.map((a) => (
        <h1>{a}</h1>
      ))}
    </div>
  );
}
